Tests are written in Solidity. If the test function reverts, the test fails, otherwise it passes. Let's go over the most common way of writing tests, using the ds-test library. ds-test provides basic logging and assertion functionality. To use it in your testing contract, import ds-test/test.sol and inherit from DSTest, like so: import "ds-test/test.sol"; contract ContractTest is DSTest { // ... tests ...
} Let's examine a basic test using ds-test: import "ds-test/test.sol"; contract BasicTest is DSTest { uint256 testNumber; function setUp() public { testNumber = 42; } function testNumberIs42() public { assertEq(testNumber, 42); } function testFailUnderflow() public { testNumber -= 43; }
} Forge uses the following keywords in tests: setUp: An optional function invoked before each test case is run uint256 testNumber; function setUp() public { testNumber = 42;
} test: Functions prefixed with test are run as a test case function testNumberIs42() public { assertEq(testNumber, 42);
} testFail: The inverse of the test prefix - if the function does not revert, the test fails function testFailSubtract43() public { testNumber -= 43;
} A good practice is to use something like testCannot in combination with the expectRevert cheatcode, instead of testFail, so you know what reverted: function testCannotSubtract43() public { cheats.expectRevert(abi.encodeWithSignature("Panic(uint256)", 0x11)); testNumber -= 43;
} You may choose to use constructor for certain logic instead of setUp. Since setUp is invoked before each test case is run, it is most suitable for "resetting" the arrangement part of your tests. If you do not want certain things to be reset every time a test is ran, use constructor instead for those. Tests are deployed to 0xb4c79dab8f259c7aee6e5b2aa729821864227e84. If you deploy a contract within your test, then 0xb4c...7e84 will be its deployer. If the contract deployed within a test gives special permissions to its deployer, such as Ownable.sol's onlyOwner modifier, then the test contract 0xb4c...7e84 will have those permissions. It is possible to use other testing libraries or roll your own. For example, if you find yourself lacking a special type of assertion, you could extend ds-test.

